def mt_to_t(vcf) :
    vcf = vcf.transmute_entries( sample = hl.struct(
        sample = vcf.s,
        ad = truncateAt( hl, vcf.LAD[ 1 ] / hl.sum( vcf.LAD ), "2" ),
        dp = vcf.DP,
        gtInt = vcf.LGT,
        gt = hl.str( vcf.LGT ),
        gq = vcf.GQ
    ) )
    vcf = vcf.annotate_rows(
        samples_germline = hl.agg.collect( vcf.sample ) 
    ) \
    .drop( 'rsid', 'gvcf_info', 'nH' ) \
    .rows()
    return vcf


